var Service = (function () {
  var _export = {
    defaultValue: function (value, def) {
      return value != undefined ? value : (def != undefined ? def : null);
    },
    checkPageUrl: function (page) {
      return location.pathname.indexOf(page) > -1;
    },
    initComponent: function (componentId, handler) {
      handler();
      $("#" + componentId).remove();
    },
    randomRange: function (min,max) {
      return Math.floor(Math.random() * (max - min) + min);
    },
    keywordInitElementId: function (keyword, callback) {
      $(document).ready(function () {
        if($("." + keyword).length) callback();  
      });
    }
  };
  return _export;
}());

var Init = (function () {
  function init(){
    _export.customScroll();
    _export.searchField();
    _export.yandexMap();
    _export.fancybox();
    _export.tabs();
    _export.feedback();
    _export.wavesEffect();

  }
  var _export = {
    customScroll: function (el) {
      el = Service.defaultValue(el,".js-custom-scroll");
      $(el).each(function (i, item) {
        if($(item).height() >= 0) $(item).customScroll();
      });

      if($(window).width() < 768){
        $(".js-custom-scroll-mobile").each(function (i, item) {
          console.log($(item));
          $(item).customScroll();
        });
      } else {
        $(".js-custom-scroll-mobile").each(function (i, item) {
          $(item).customScroll("destroy");
        });
      }
    },
    searchField: function (el) {
      SearchField.bindFocusEvent(el);
    },
    yandexMap: function (el) {
      YandexMap.buildMap();
    },
    fancybox: function () {
      $.fancybox.defaults.beforeLoad = function () {
        $("html,body").css({overflow:"hidden"});
        $(".search-form_is-pinned").css({paddingRight: "17px"});
      };
      $.fancybox.defaults.afterClose = function () {
        $("html,body").css({overflow:"auto"});
        $(".search-form_is-pinned").css({paddingRight: "0"});
      };
      $.fancybox.defaults.touch = false;
      $(".js-fancybox-close").on("click",function () {
        $.fancybox.close();
      });
    },
    tabs: function (el) {
      Tabs.init(el);
    },
    feedback: function () {
      $(".js-popup-feedback-show").on("click",function () {
        Feedback.showPopup({
          action: $(this).attr("data-action")
        });
      });
    },
    wavesEffect: function (el) {
      el = Service.defaultValue(el,"");
      Waves.attach(el + ' .product__amount-inc,.product__amount-dec,.product__delete,.button:not(.button_disabled)');
      Waves.init();
    }
  };
  $(document).ready(function () {
    init();
  });
  return _export;
})();

var Template = (function () {
  var _export = {
    html: function (params) {
      $(params.selector).html(params.data);
    },
    append: function (params) {
      $(params.selector).append(params.data);
    },
    prepend: function (params) {
      $(params.selector).prepend(params.data);
    },
    requireComponent: function (params) {
      params.templateParams = Service.defaultValue(params.templateParams,{});
      $.ajax({
        url: params.path + "?" + $.param(params.templateParams),
        success: function (resp) {
          params.handler({
            data: resp,
            selector: params.selector
          });
        }
      });
    }
  };
  return _export;
})();

var SearchField = (function () {

  function init(){
    $(".search-field").each(function (i, item) {
      _export.bindFocusEvent($(item));
    });
  }
  var _export = {
    bindFocusEvent: function (el) {
      el = Service.defaultValue(el,".search-field");
      $(el).each(function (i, item) {
        var inputField = $(item).find(".search-field__input");
        inputField.on("focus",function () {
          $(item).addClass("search-field_focused");
        });
        inputField.on("blur",function () {
          $(item).removeClass("search-field_focused");
        });
      });
    },
    updateLiveSearch: function (data) {
      var result = "";
      if(!data.length) data.push({
        value: "Ничего не найдено",
        url: "#"
      });
      data.forEach(function (item, i) {
        var searchItemTemplate = `
          <div class="search-field__live-search__item">
            <a href="${data[i].url}">
              ${data[i].value}
            </a>
          </div>
        `;
        result += searchItemTemplate;
      });
      $(".search-field__live-search").html(result);
    }
  };
  return _export;
}());

var Tabs = (function () {
  var tabsList = [];
  function init(el) {
    $(Service.defaultValue(el,".tabs")).each(function (i, tabs) {
      tabsList.push(new TabsElement({
        tabsId: $(tabs).attr("data-tabs"),
        tabsContainer: $(tabs).find(".tabs__container"),
        tabsControl: $(tabs).find(".tabs__control__item"),
        tabsContent: $(tabs).find(".tabs__content")
      }));
      tabsList.forEach(function (tabs, index) {
        $(tabs.tabsControl).each(function (i, item) {
          var controlId = $(item).attr("data-tab-control");
          $(item).on("click",function () {
           tabsList[index].changeTab(controlId);
          });
          if(i == 0) tabsList[index].changeTab(controlId);
        });
      });
    });
    console.log($(".tabs"));
  }
  var TabsElement = function (params) {
    var _this = this;
    this.tabsId = params.tabsId;
    this.tabsContainer = params.tabsContainer;
    this.tabsControl = params.tabsControl;
    this.tabsContent = params.tabsContent;
    this.changeTab = function (id) {
      $(_this.tabsControl).each(function () {
        var tabsControl = $(this);
        if(tabsControl.attr("data-tab-control") == id){
          tabsControl.addClass("tabs__control__item_is-active");
          $(_this.tabsContent).each(function (i, item) {
            var tabsContent = $(this);
            if(tabsContent.attr("data-tab-content") == id) tabsContent.show();
            else tabsContent.hide();
          });
        } else {
          tabsControl.removeClass("tabs__control__item_is-active");
        }
      });
    };
  };
  return {
    getTabsList: function () {
      return tabsList;
    },
    init: function () {
      init();
    }
  };
}());

