var Toast = (function () {
  var toastsList = [];
  function init(){
    $(document).ready(function () {
      $("body").append('<div class="toast-container"></div>');
    });
  }
  var defaultValue = function (checkedValue,defaultValue) {
    return (checkedValue != undefined) ? checkedValue : defaultValue;
  };
  var ToastItem = function (params) {
    var toast = this;
    toast.id = toastsList.length;
    toast.title = defaultValue(params.title,"");
    toast.content = params.content;
    toast.type = params.type;
    toast.timeout = params.timeout;
    toast.callback = params.callback;
    toast.getElement = function () {
      return $("#toast-" + toast.id);
    };
    toast.destroy = function () {
      toast.element.css({
        "opacity": "0",
        "max-width": "50px",
        "margin-bottom": "-50px",
        "line-height": "0"
      });
      setTimeout(function () {
        toast.getElement().remove();
        delete toastsList[toast.id];
      },500);

    };
    toast.show = function () {
      var htmlContainer = $(".toast-container");
      toast.element = htmlContainer.prepend('<div class="toast-item ' + defaultValue(toast.type,"success") + '" id="toast-' + toast.id + '"><div class="toast-title">' + toast.title + '</div><div class="toast-content">' + toast.content + '</div></div>').find("#toast-" + toast.id);
      setTimeout(function () {
        toast.element.css({
          "max-width": "100%",
          "color": "white",
          "margin-bottom": "5px",
        });
        setTimeout(function () {
          toast.element.css("line-height","1.2em");
        },300);
      },20);

      toast.getElement().on("click",function () {
        if(typeof toast.callback == "function") toast.callback();
        else toast.destroy();
      });
      setTimeout(toast.destroy,defaultValue(toast.timeout,3000));
    };
  };
  init();

  return {
    createToast: function (contentParams,configParams) {
      var toast = new ToastItem(contentParams);
      toastsList.push(toast);
      toast.show();
    },
    clearToasts: function (params) {
      toastsList.forEach(function (item, i, arr) {
        item.destroy();
      });
    },
    getToastsList: function () {
      return toastsList;
    }
  };
}());

