(function () {
  // Когда нибудь я разгребу это дерьмо, но не сегодня.
  // Как говориться, работает - не трожь
  var isMobile = false;
  var lastState = 0;
  var responsiveValue;
  function resposiveState(){
    var ww = $(window).width();
    resposiveValue = (ww < 1480 && ww >= 1200  ? 1 : 0) + (ww < 1200 && ww >= 1024  ? 2 : 0) + (ww < 1024 && ww > 768  ? 3 : 0) + (ww < 768  ? 4 : 0);
    if(ww <= 768){
      Config.responsive.mobileEnabled = true;
      responsiveValue = 4;
    } else Config.responsive.mobileEnabled = false;
    Config.responsive.state = responsiveValue;
    return Config.responsive;
  }
  $(document).ready(function () {
    resposiveState();
  });
  $(window).on("resize",function () {
    console.log(resposiveValue);
    if(lastState != resposiveState().mobileEnabled) Init.customScroll();
    lastState = resposiveState().mobileEnabled;
  });
}());

