var Catalog = (function () {
  var _export = {
    showOrderInfo: function (data) {
      // Показываем попап при добавлении товара в корзину
      $.fancybox.close(true);
      var cost = data.data.total_cost;
      var count = data.data.total_count;
      $(".js-order-info-count").html(count);
      $(".js-order-info-cost").html(cost);
      $.fancybox.open({
        type: "inline",
        src: "#popup_order_info"
      });
      var discountProgress = (data.data.sum / Config.price.maxDiscountProgress) * 100;
      $(".js-order-info-progress").css({
        width: cost < Config.price.maxDiscountProgress ? (discountProgress > 5 ? discountProgress + "%": "5%"): "100%"
      });
    },
    addToCart: function (el) {
      // Често хз, зачем это надо, но когда то требовалось столь неординарное решение
      if(!!window.jQuery && !!Catalog) $(el).parents().eq(2).submit();
      // UPD Я нашел откуда это идет. Это мастхэв фича и лучше ее не трогать.
    },
    orderProduct: function (el) {
      var $card = $(el).parents().eq(4);
      var cardContent = {
        picture: $card.find(".js-product-item-picture").html(),
        title: $card.find(".js-product-item-title").html(),
        id: $card.find("input[name='id']").val()
      };
      $.fancybox.open({
        src: "#popup_order_product",
        type: "inline"
      });
      $(".js-popup-order-product-picture").html(cardContent.picture);
      $(".js-popup-order-product-title").html(cardContent.title);
      $(".js-popup-order-product-id").val(cardContent.id);
    },
    changeCartButtonCount: function (data) {
      console.log("changeCartButtonCount",data.data.total_cost > 0);
      var $cost = $(".js-mini-cart-cost");
      var $count = $(".js-mini-cart-count");
      if(data.data.total_cost > 0){
        $cost.html(data.data.total_cost + " руб.");
        $count.css({display: "inline-flex"});
        $count.html(data.data.total_count);
      } else {
        $cost.html("Корзина");
        $count.hide();
      }
    }
  };
  return _export;
})();
