Service.keywordInitElementId("stages__order",function () {
  Inputmask({"mask": "+7 (999) 999-9999"}).mask("input[name='phone']");
  var errorText = "Данное поле заполнено не верно";
  var validHandler = function (el,status) {
    $element = $(el);
    $notify = $(el + " + .form-notify");
    if(status){
      $element.removeClass("order__form__input_error");
      $notify.hide();
    } else {
      $element.addClass("order__form__input_error");
      $notify.show();
      $notify.html(errorText);
    }
  };
  var validateItems = [{
      element: "#order_fio",
      condition: "length",
      params: {
          min: 2,
          max: 30
      },
      success: function () {
        validHandler(this.element,true);
      },
      error: function () {
        validHandler(this.element,false);
      }
  },
  {
      element: "#order_email",
      condition: "pattern",
      pattern: "email",
      success: function () {
        validHandler(this.element,true);
      },
      error: function () {
        validHandler(this.element,false);
      }
  },
  {
      element: "#order_phone",
      condition: "pattern",
      pattern: "phone",
      required: true,
      success: function () {
        validHandler(this.element,true);
      },
      error: function () {
        validHandler(this.element,false);
      }
  },
  {
    element: "#policy_checkbox",
    condition: "checked",
    required: true
  }
  ];
  var checkValid = function () {
    Validate.checkValid(validateItems, {
    success: function() {
        $(".order__button").removeClass("button_disabled");
        $(".order__button").attr("disabled",false);
    },
    error: function() {
        $(".order__button").addClass("button_disabled");
        $(".order__button").attr("disabled",true);
    }
  });
};
  Validate.bindHandler(validateItems);
  $(".order__form").find("input").on("change",checkValid);
  setInterval(checkValid,1000);
});

