var MiniCart = (function () {
  var $list;
  var $miniCartList;
  Service.keywordInitElementId("mini-cart",function () {
    $miniCartList = $(".mini-cart__content__list");
    $list = $(".mini-cart__content__list__items");
    console.log("MCL",$list.children().length);
    if($list.children().length >= 6){
      $miniCartList.customScroll();
    }
    $list.on("click",".mini-cart__form-delete",function () {
      var removedItemId = $(this).data("id");
      $("#" + removedItemId).hide();
    });
  });
  var _export = {
    update: function (data) {
      console.log("UPDATE DATA",data);
      var cart = data.data.cart;
      var cartRenderElement = "";
      cart.forEach(function (item, i) {
        var miniCartItemTemplate = `
          <div class="mini-cart__content__list__item" id="mini-cart_id-${i}">
            <div class="mini-cart__content__list__item__el mini-cart__content__list__item__title">
              ${cart[i].name}
            </div>
            <div class="mini-cart__content__list__item__el mini-cart__content__list__item__count">
              ${cart[i].count} шт.
            </div>
            <div class="mini-cart__content__list__item__el mini-cart__content__list__item__price">
              ${cart[i].cost} руб.
            </div>
            <form method="post" class="mini-cart__form-delete ms2_form" data-id="mini-cart_id-${i}">
              <input type="hidden" name="key" value="${cart[i].key}">
              <button class="button button_round" type="submit" name="ms2_action" value="cart/remove">
                <div class="row-product__delete-button sprite sprite-cart-remove"></div>
              </button>
            </form>
          </div>
        `;
        cartRenderElement += miniCartItemTemplate;
      });
      console.log("MiniCart get data: ",cart);
      if(cart.length > 6) $miniCartList.customScroll();
      else $miniCartList.customScroll('destroy');
      $list.html(cartRenderElement);

      if(cart.length > 0) $(".mini-cart__content").removeClass("hidden");
      else $(".mini-cart__content").addClass("hidden");
    },
    removeItem: function (item) {
      //$item.submit();

      var $item = $(item).parents().eq(0);
      $item.submit();
      $item.hide();
    }

  };
  return _export;
})();

