var Feedback = (function () {
  // Ну малость наговнякал. Извиняюсь
  var $form = $(".js-popup-feedback-action");
  $form.each(function (i, item) {
    // Перебираем все формы в с классом
    $(item).on("submit",function (e) {
      _export.sendFeedback(e);
    });
  });
  $(".js-feedback-rate").on("click",function () {
    // При заказе тыкая на лицо
    _export.sendRate($(this));
  });
  var _export = {
    initValid: function () {
      // Хз когда то было нужно
    },
    showPopup: function (params) {
      // Попап с обратной свзяью
      $.fancybox.open({
        src: "#popup_feedback_" + params.action,
        type: "inline"
      });
    },
    sendFeedback: function (e) {
      e.preventDefault();
      var query = "msg_action=" + $(e.target).attr("data-action") + "&" + $(e.target).serialize();
      $.ajax({
        url: "/feedback.php",
        method: "POST",
        data: query,
        success: function (resp) {
          resp = JSON.parse(resp);
          console.log(resp);
          if(resp.status == "success"){
            $.fancybox.close();
          } else {
            // Перебираем поля для указания валидности
            for(var key in resp.valid){
              var $item = $(".popup__feedback__container *[name=" + key + "]");
              if(!resp.valid[key]) $item.addClass("input_invalid");
              else $item.removeClass("input_invalid");
            }
          }
          setTimeout(function () {
            Toast.createToast({content: resp.message, type: resp.status});
          },500);
        }
      });
    },
    sendRate: function (self) {
      var query = "msg_action=score&value=" + $(self).attr("data-feedback-rate") + "&id=" + $(self).attr("data-feedback-rate");
      $.ajax({
        url: "/feedback.php",
        method: "POST",
        data: query
      });
    },
    sendSubscribe: function (self) {
      var query = "msg_action=subscribe&" + $(self).serialize();
      $.ajax({
        url: "/feedback.php",
        method: "POST",
        data: query,
        success: function (resp) {
          $(self).html('<span class="highlight-text_green">' + Config.strings.feedbackSubscribe + "</span>");
        }
      });
    }
  };
  return _export;
})();
